import Link from "next/link";

const LandingHeader = () => (
  <div className="landing">
    <h1>Woo Young Choi</h1>
    <p>I build things for the web.</p>
    <style jsx>
      {`
        .landing {
          color: #00ace6;
          display: block;
          font-family: "Georgia, serif";
        }

        h1 {
          font-size: 30px;
          font-weight: normal;
        }

        p {
          font-size: 20px;
        }
      `}
    </style>
  </div>
);

export default LandingHeader;
